import React, { Component } from 'react';
import CarouselPage from '../components/Carousel/slider';

import './reset.scss';
import './index.scss';

export default class Home extends Component {
    render() {
        return (
            <div>
                <CarouselPage />
                
            </div>    
        );
    }
}
